import classes from './Radar.module.css'

const Radar = () => {
    return (
        <div className={classes.radarContainer}>
            <div className={classes.radar}></div>
            <div class="radar">
                <div id="top" class="degreeLabel">360</div>
                <div id="right" class="degreeLabel">90</div>
                <div id="bottom" class="degreeLabel">180</div>
                <div id="left" class="degreeLabel">270</div>
            </div>


            <div>
                {Array.from({ length: 36 }, (_, i) => (
                    <div
                        key={i}
                        className={`degreeMarking rotate-${i * 10}`}
                    ></div>
                ))}
            </div>
        </div>
    );
}

export default Radar;
